svg.script:
        // dragobj:拖曳模組、QuesData:題目、Timer:計時器
        var QuesData;
        var QuesTitle;
        var QuesAudio;
        var Timer;
        // 外層丟 nowLv:目前難度(1易 2中 3難)，nowCat:目前類別(1觀察 2推理 3記憶 4素養) nowSec:遊戲總時數(倒數)
        var nowLv = 0;
        var nowCat = 0;
        var nowSec = 0;

        //測試模式
        var isTestMode = false;
        //是否鎖定點擊
        var isBlock = false;
        // isAns:本題是否答對、isQuit:本題是否放棄、isEnd:是否時間到
        var isAns, isQuit, isEnd;
        // isStartGame:是否開始遊戲、isTimePause:是否暫停計時、isFirstGame:是否第一次進入遊戲(唸旁白)
        var isStartGame = false;
        var isTimePause = false;
        var isFirstGame = true;
        // isSound:是否正在播音效/旁白
        var isSound = false;
        // SoundNum:旁白數量、SoundNow:目前旁白
        var SoundNum = 0;
        var SoundNow = 0;
        // isBGM:是否播放背景音樂
        var isBGM = true;
        // 背景音量
        var BGMvol = 0.5;

        // 依照各題所需客製 b_ary:格子狀態、boxn:箱子數
        var b_ary = [];
        var boxn;
        // QuesNo:題號亂數打亂陣列、NowNo:目前出第幾題(抓QuesNo裡)、NowQues:本題題目
        var QuesNo, NowNo, NowQues;
        var WrongQues;

        function ClickEvent() {
            let objary = document.querySelectorAll(".ee-obj");
            objary.forEach((obj) => {
                obj.onclick = function(e) {            
                    if(obj.classList.contains("bsstart")) {
                        // console.log("開始遊戲 ====");
                        StartGame();                       
                    }
                    if(obj.classList.contains("bsreplay")) {
                        // console.log("再玩一次 ====");
                        window.parent.GameInit();
                    }
                    if(!isStartGame) return;
                    if(nowSec <= 0) return;
                    if(isBlock) return;              
                    if(obj.classList.contains("bsrefresh")) {
                        // console.log("重整 ====");
                        ResetBrick();
                    }                    
                    if(obj.classList.contains("bsquit")) {
                        if(isQuit) return;
                        WrongQues.push(QuesNo[NowNo]);
                        NowNo++;

                        isAns = false;
                        isQuit = true;
                        isEnd = (nowSec > 0 ? false : true);

                        PlayOX(isAns, isQuit, isEnd);
                    }
                }
            });
        }

        var svgNScr = "http://www.w3.org/2000/svg";
        var svgNSat = "http://www.w3.org/1999/xlink";
        var isDragging = false;
        const svg = document.getElementById('svgObj');
        const svgRect = document.getElementById('svgObj').getBoundingClientRect();
        var svgScale;
        var thisbk;
        var group,g_dx,g_dy;
        var svg_x_off, svg_y_off;
        var target = [0, 0, 0];

        function DragEvent() {
            // console.log("DragEvent ====== boxn =", boxn);
            for(var i = 0; i < boxn; i++) {
                var AnsObj = document.getElementById("Ans_" + i);
                AnsObj.addEventListener('mousedown', downActive);
                AnsObj.addEventListener("touchstart", downActive);
            }
        }
        function downActive(event){
            event.preventDefault(); 
            // console.log("downActive == isStartGame =", isStartGame, ", nowSec =", nowSec, ", isBlock =", isBlock);
            if(!isStartGame) return;
            if(nowSec <= 0) return;
            if(isBlock) return;

            var targetobj = event.currentTarget;
            target[0] = parseInt(targetobj.getAttribute("bn"));
            target[1] = parseInt(targetobj.getAttribute("fx"));
            target[2] = parseInt(targetobj.getAttribute("fy"));
            target[3] = (parseInt(targetobj.getAttribute("num")) == 0 ? 2 : parseInt(targetobj.getAttribute("num")));
            target[4] = parseInt(targetobj.getAttribute("dir"));
            // console.log("target =", target);

            if(target[4] == 0) {
                target = [];
                return;
            }
        
            thisbk = parseInt(String(this.id).slice(String("Ans_").length, String(this.id).length));
            this.parentNode.appendChild(this);
            group = this;
            isDragging = true;
            svgScale = [svg.clientWidth / 1024, svg.clientHeight / 768];

            if(event.type == "touchstart"){
                clientX = event.touches[0].clientX;
                clientY = event.touches[0].clientY;
            }else{
                clientX = event.clientX;
                clientY = event.clientY;
            }

            var AnsBoxXY = GetTranslateXY("AnsBox");
            var tempxy = GetTranslateXY("Ans_" + thisbk);
            svg_x_off = tempxy[0];
            svg_y_off = tempxy[1];
            // console.log("clientX =", parseInt(clientX), ", clientY =", parseInt(clientY), ", svgScale =", svgScale);
            // console.log("AnsBoxXY =", AnsBoxXY, ", tempxy =", tempxy);

            //clientX = clientX - PuzzleBoxXY[0] * svgScale[0] - QuesMainXY[0] * svgScale[0] - svgMainXY[0 * svgScale[0]];
            //clientY = clientY - PuzzleBoxXY[1] * svgScale[1] - QuesMainXY[1] * svgScale[1] - svgMainXY[1] * svgScale[1];

            var tempRect = document.createElementNS(svgNScr, 'rect');
            tempRect.setAttribute('id', 'tempRect');
            tempRect.setAttribute('width', '100%');
            tempRect.setAttribute('height', '100%');
            tempRect.setAttribute('fill', '#FFFFFF');
            tempRect.setAttribute('opacity', '0.3');
            this.appendChild(tempRect);

            var groupRect = tempRect.getBoundingClientRect();
            var groupX = groupRect.left - svgRect.left;
            var groupY = groupRect.top - svgRect.top;
            g_dx = (clientX - svgRect.left) - groupX;
            g_dy = (clientY - svgRect.top) - groupY;
            this.removeChild(tempRect);
            // console.log("groupRect =", parseInt(groupRect.left), ", ", parseInt(groupRect.top), ", svgRect =", parseInt(svgRect.left), ", ", parseInt(svgRect.top), ", ", svg.clientWidth, ", ", svg.clientHeight);
            // console.log("groupX =", parseInt(groupX), ", groupY =", parseInt(groupY));
            // console.log("g_dx =", parseInt(g_dx), ", g_dy =", parseInt(g_dy));

            document.addEventListener('mousemove', moveActive);
            document.addEventListener("touchmove", moveActive);
            document.addEventListener('mouseup', enddrag);
            document.addEventListener("touchend", enddrag);
        }
        function GetTranslateXY(id) {
            var obj = document.getElementById(id);
            var transform = obj.getAttribute("transform");
            var translate = String(transform).split("translate(");            
            var val = String(translate[1]).split(",");
            var val2 = String(val[1]).split(")");

            var x = parseInt(val[0]);
            var y = parseInt(val2[0]);
            // console.log("x =", x, ", y =", y);
            return [x, y];
        }
        function moveActive(event){
            event.preventDefault(); 
            if (isDragging) {            
                //*****  處理位移偏差值
                if(event.type == "touchmove"){
                    clientX = event.touches[0].clientX;
                    clientY = event.touches[0].clientY;
                }else{
                    clientX = event.clientX;
                    clientY = event.clientY;
                }
                // console.log("thisbk =", thisbk, ", clientX =", parseInt(clientX), ", clientY =", parseInt(clientY));
                var AnsBoxXY = GetTranslateXY("AnsBox");

                var svg_x = clientX - g_dx - svgRect.left;
                var svg_y = clientY - g_dy - svgRect.top;
                // console.log("svg_x =", svg_x, ", svg_y =", svg_y);
                svg_x = svg_x - (AnsBoxXY[0] * svgScale[0]);
                svg_y = svg_y - (AnsBoxXY[1] * svgScale[1]);
                var svgstyle = window.getComputedStyle(svg);
                let startViewBox = svg.getAttribute('viewBox').split(' ').map(n => parseFloat(n))
                svg_x_off =  parseInt(svg_x / ( parseInt(svgstyle.width,10)/startViewBox[2]));
                svg_y_off =  parseInt(svg_y /  ( parseInt(svgstyle.height,10)/startViewBox[3]));
                // console.log("startViewBox =", startViewBox);
                // console.log("svg_x =", svg_x, ", svg_y =", svg_y);
                // console.log("svg_x =", svg_x, ", svg_y =", svg_y);
                // console.log("svg_x_off : "+svg_x_off, ", svg_y_off : "+svg_y_off );
                // console.log("target =", target);

                //***** 限制方塊可移範圍
                var lmov, rmov, tmov, bmov;
                var lint, rint, tint, bint;
                lint = rint = tint = bint = 0;
                lmov = rmov = tmov = bmov = 0;
                if(target[4] == 1) {
                    //禁止水平移動
                    lint = 0;
                    rint = 0;
                    if(target[0] <= 6) {
                        tint = 0;
                    } else {
                        for(var i = target[0] - 7; i >= 0; i-=7) {
                            // console.log("T i =", i, ", b_ary =", b_ary[i], ", b_ary =", b_ary);
                            //if(i == target[0]) continue;
                            if(b_ary[i] == 1) break;
                            tmov++;
                        }
                    }

                    if(target[0] >= 42) {
                        bint = 0;
                    } else {
                        for(var i = (target[0] + target[3] * 7); i <= 48; i+=7) {
                            // console.log("B i =", i, ", b_ary =", b_ary[i], ", b_ary =", b_ary);
                            //if(i == target[0]) continue;
                            if(b_ary[i] == 1) break;
                            bmov++;
                        }
                    }
                    //tint = tmov * 85 * svgScale[1];
                    //bint = bmov * 85 * svgScale[1];
                    tint = tmov * 85;
                    bint = bmov * 85;
                } else {
                    //禁止垂直移動
                    tint = 0;
                    bint = 0;
                    var templ = Math.floor(target[0] / 7) * 7;
                    var tempr = templ + 6;
                    // console.log("templ =", templ, ", tempr =", tempr);
                    if(target[0] == templ) {
                        lint = 0;
                    } else {
                        for(var i = target[0] - 1; i >= templ; i--) {
                            // console.log("L i =", i, ", b_ary =", b_ary[i], ", b_ary =", b_ary);
                            if(b_ary[i] == 1) break;
                            lmov++;
                        }
                    }

                    if(target[0] == tempr) {
                        rint = 0;
                    } else {
                        for(var i = target[0] + target[3]; i <= tempr; i++) {
                            // console.log("R i =", i, ", b_ary =", b_ary[i], ", b_ary =", b_ary);
                            if(b_ary[i] == 1) break;
                            rmov++;
                        }
                    }
                    //lint = lmov * 85 * svgScale[1];
                    //rint = rmov * 85 * svgScale[1];
                    lint = lmov * 85;
                    rint = rmov * 85;
                }
                // console.log("lint =", lint, ", rint =", rint, ", tint =", tint, ", bint =", bint);
                // console.log("lmov =", lmov, ", rmov =", rmov, ", tmov =", tmov, ", bmov =", bmov);

                if(svg_x_off >= (target[1] + rint)) svg_x_off = (target[1] + rint); 
                if(svg_x_off <= (target[1] - lint)) svg_x_off = (target[1] - lint);
                if(svg_y_off >= (target[2] + bint)) svg_y_off = (target[2] + bint);
                if(svg_y_off <= (target[2] - tint)) svg_y_off = (target[2] - tint);
                // console.log("org b_ary =", b_ary);  

                group.setAttribute("transform", "translate(" + (svg_x_off) + "," + (svg_y_off) + ")");
                // console.log("svg_x_off =", svg_x_off, ", svg_y_off =", svg_y_off);            
            }
        }
        function enddrag() {
            var ent = false;
            var offsetN = 40;
            // console.log("svg_x_off =", svg_x_off, ", svg_y_off =", svg_y_off);

            var tempx = Math.round(svg_x_off / 85);
            var tempy = Math.round(svg_y_off / 85);
            var tempb = tempx + tempy * 7;
            svg_x_off = 85 * tempx;
            svg_y_off = 85 * tempy;

            // console.log("svg_x_off =", svg_x_off, ", svg_y_off =", svg_y_off);
            group.setAttribute("transform", "translate(" + (svg_x_off) + "," + (svg_y_off) + ")");
            group.setAttribute("fx", svg_x_off);
            group.setAttribute("fy", svg_y_off);
            
            // console.log("tempx =", tempx, ", tempy =", tempy, ", tempb =", tempb);

            //更新格子狀態
            if(target[4] == 1) {
                for(var i = target[0]; i < target[0] + target[3] * 7; i+=7) {
                    b_ary[i] = 0;
                }
                for(var i = tempb; i < tempb + target[3] * 7; i+=7) {
                    b_ary[i] = 1;
                }
            } else {
                var templ = Math.floor(target[0] / 7) * 7;
                var tempr = templ + 6;
                for(var i = target[0]; i < target[0] + target[3]; i++) {
                    b_ary[i] = 0;
                }
                for(var i = tempb; i < tempb + target[3]; i++) {
                    b_ary[i] = 1;
                }
            }
            // console.log("b_ary =", b_ary);

            group.setAttribute("bn", tempb);
            target = [];

            var checkNum = parseInt(group.getAttribute("num"));
            if(checkNum == 0) {
                if(svg_x_off >= 390) {
                    group.setAttribute("transform", "translate(" + (svg_x_off + 85) + "," + (svg_y_off) + ")");
                    //答對
                    isEnd = false;
                    NowNo++;
                    if(NowNo >= QuesNo.length) {
                        if(WrongQues.length > 0) {
                            CheckWrongQues();
                        } else {
                            isEnd = true;
                        }
                    }
                    isAns = true;
                    isTimePause = true;
                    isQuit = false;
                    PlayOX(isAns, isQuit, isEnd);
                }
            }

            isDragging = false;

            document.removeEventListener('mousemove', moveActive);
            document.removeEventListener("touchmove", moveActive);
            document.removeEventListener('mouseup', enddrag);
            document.removeEventListener("touchend", enddrag);
        }
        function PlayAnimate(obj) {
            var AniObj = document.getElementById(obj);

            AniObj.querySelectorAll("animateTransform").forEach((element) => {
                element.beginElement();
            });
            AniObj.querySelectorAll("animate").forEach((element) => {
                element.beginElement();
            });
        }
        function InitGame() {
            // console.log("初始遊戲 === ");
            if(isTestMode) {
                isFirstGame = false;
                isBGM = false;
            }
            QuesData = window.parent.NowQues.Ques;
            QuesTitle = window.parent.QuesTitle;
            WrongQues = [];
            // console.log("in svg QuesData =", QuesData);
            // console.log("in svg QuesTitle =", QuesTitle);
            // console.log("in svg nowLv =", nowLv);
            // console.log("in svg nowSec =", nowSec);

            //按鈕事件
            ClickEvent();

            isStartGame = false;
            isTimePause = false;

            var GameClear = document.getElementById("GameClear");
            GameClear.setAttribute("style", "display: none;");
            
            var TitleText = document.getElementById("TitleText");
            var TitleTxt_1 = document.getElementById("TitleTxt_1");
            var TitleTxt_2 = document.getElementById("TitleTxt_2");
            if(QuesTitle.indexOf("\n") >= 0) {
                //顯示成兩行題目
                var quesTitle = QuesTitle.split("\n");
                TitleTxt_1.innerHTML = quesTitle[0];
                TitleTxt_2.innerHTML = quesTitle[1];
            } else {
                if(String(QuesTitle).length > 30) {
                    //題目太長，拆成兩行
                    var quesTitle_1 = String(QuesTitle).slice(0, 30);
                    var quesTitle_2 = String(QuesTitle).slice(30, String(QuesTitle).length);
                    TitleTxt_1.innerHTML = quesTitle_1;
                    TitleTxt_2.innerHTML = quesTitle_2;
                } else {
                    TitleTxt_1.innerHTML = QuesTitle;
                }
            }
            
            var QuesStart = document.getElementById("QuesStart");
            QuesStart.setAttribute("style", "display: block;");
            
            QuesNo = GetRandomAry(QuesData.length);
            NowNo = 0;

            SetClock();

            var StartBtn = document.getElementById("StartBtn");
            StartBtn.setAttribute("style", "display: block;");
        }
        function PlayOX(isans, isquit, isend) {
            isBlock = true;
            var top, left;
            if(isans) {
                top = 0.55;
                left = 0.34;
            } else {
                top = 0.55;
                left = 0.34;
            }
            window.parent.CallAnsFunc(isans, isquit, isend, top, left);
        }
        function PlayAudio(name) {
            var StartBtn = document.getElementById("StartBtn");
            var audio = QuesAudio[name];
            var vol = 1;
            // console.log("audio =", audio);
            switch(name) {
                case "bgm": //背景音樂
                            isBGM = true;
                            vol = BGMvol;
                            break;
                case "sound": //旁白
                            isSound = true;
                            StartBtn.setAttribute("style", "display: none;");
                            break;
            }
                      
        }
        function ResetGame() {
            // console.log("ResetGame ====");
            isAns = false;
            isEnd = false;
        }
        function StartGame() {
            // console.log("開始遊戲 === ");
            isStartGame = true;
            var QuesStart = document.getElementById("QuesStart");
            QuesStart.setAttribute("style", "display: none;");
            
            NewQues();

            Timer = setTimeout(TimerCount, 1000);
        }
        function GameClear() {
            var GameClear = document.getElementById("GameClear");
            GameClear.removeAttribute("style");
            var AnsBox = document.getElementById("AnsBox");
            //先清空
            while (AnsBox.lastElementChild) {
                AnsBox.removeChild(AnsBox.lastElementChild);
            }
            clearTimeout(Timer);
        }
        function CheckWrongQues() {
            QuesNo.length = 0;
            QuesNo = QuesNo.concat(WrongQues);
            WrongQues.length = 0;
            NowNo = 0;
        }
        function NextQues() {
            // console.log("NextQues === NowNo =", NowNo, ", QuesNo =", QuesNo);
            if(NowNo >= QuesNo.length) {
                // console.log("end ========== WrongQues =", WrongQues);     
                if(WrongQues.length > 0) {
                    CheckWrongQues();
                    NewQues();
                } else {
                    GameClear();
                }
            } else {
                NewQues();
            }
        }
        function NewQues() {
            // console.log("出新題目 === NowNo =", NowNo, ", No =", QuesNo[NowNo]);
            isAnd = false;
            isQuit = false;

            ResetGame();
            isTimePause = false;
            isBlock = false;

            boxn = 0;
            b_ary = [];
            //設置7*7陣列
            for(var i = 0; i < 49; i++) {
                b_ary.push(0);
            }

            NowQues = QuesData[QuesNo[NowNo] - 1];
            var AnsBox = document.getElementById("AnsBox");
            //先清空
            while (AnsBox.lastElementChild) {
                AnsBox.removeChild(AnsBox.lastElementChild);
            }
            
            for(var i = 0; i < NowQues.length; i++) {
                boxn++;
                var AnsObj = document.getElementById("AnsObj").cloneNode(true);
                AnsObj.setAttribute("id", "Ans_" + i);
                AnsObj.setAttribute("class", "ee-obj ee-anscontainer");
                var tempx = NowQues[i][0] / 80 * 85;
                var tempy = NowQues[i][1] / 80 * 85;
                AnsObj.setAttribute("transform", "translate(" + tempx + "," + tempy + ")");
                AnsObj.setAttribute("num", NowQues[i][2]);
                AnsObj.setAttribute("dir", NowQues[i][3]);
                AnsObj.setAttribute("fx", tempx);
                AnsObj.setAttribute("fy", tempy);
                AnsObj.setAttribute("ox", tempx);
                AnsObj.setAttribute("oy", tempy);

                var rect = AnsObj.querySelector("rect");                

                //格子狀態                
                var xn = NowQues[i][0] / 80;
                var yn = NowQues[i][1] / 80;
                var bn = 7 * yn + xn;
                AnsObj.setAttribute("bn", bn);
                AnsObj.setAttribute("on", bn);
                if(NowQues[i][2] == 1) {
                    b_ary[bn] = 1;
                    rect.setAttribute("width", NowQues[i][2] * 80);
                    rect.setAttribute("height", NowQues[i][2] * 80);
                } else {
                    if(NowQues[i][2] == 0) {
                        b_ary[bn] = 1;
                        b_ary[bn + 1] = 1;                        
                        rect.setAttribute("width", 2 * 80);
                        rect.setAttribute("height", 1 * 80);
                    } else {
                        if(NowQues[i][3] == 1) {
                            for(var j = 0; j < NowQues[i][2]; j++) {
                                b_ary[bn + j * 7] = 1;
                            }                            
                            rect.setAttribute("width", 1 * 80);
                            rect.setAttribute("height", NowQues[i][2] * 80);
                        } else {
                            for(var j = 0; j < NowQues[i][2]; j++) {
                                b_ary[bn + j] = 1;
                            }                            
                            rect.setAttribute("width", NowQues[i][2] * 80);
                            rect.setAttribute("height", 1 * 80);
                        }
                    }
                }

                var obj = (NowQues[i][2] == 0 || NowQues[i][2] == 1 ? "BrickClip" + NowQues[i][2] : "BrickClip" + NowQues[i][2] + "_" + NowQues[i][3]);
                var image = AnsObj.querySelector("use");
                var tempx = document.getElementById(obj).querySelector("rect").getAttribute("x");
                var tempy = document.getElementById(obj).querySelector("rect").getAttribute("y");
                var scale = 1.195;
                image.setAttribute("transform", "scale(" + scale + ") translate(-" + tempx + ",-" + tempy + ")");
                image.setAttribute("clip-path", "url(#" + obj + ")");

                AnsBox.appendChild(AnsObj);
            }

            DragEvent();
        }
        function ResetBrick() {
            var Ans = document.querySelectorAll(".ee-anscontainer");
            for(var i = 0; i < 49; i++) {
                b_ary[i] = 0;
            }
            for(i = 0; i < Ans.length; i++) {
                var tempn = parseInt(Ans[i].getAttribute("num"));
                var tempd = parseInt(Ans[i].getAttribute("dir"));
                var tempx = parseInt(Ans[i].getAttribute("ox"));
                var tempy = parseInt(Ans[i].getAttribute("oy"));
                var tempb = parseInt(Ans[i].getAttribute("on"));
                Ans[i].setAttribute("transform", "translate(" + tempx + "," + tempy + ")");
                Ans[i].setAttribute("bn", tempb);
                Ans[i].setAttribute("fx", tempx);
                Ans[i].setAttribute("fy", tempy);
                // console.log("tempn =", tempn, ", tempd =", tempd, ", tempx =", tempx, ", tempy =", tempy, ", tempb =", tempb);

                if(tempn == 1) {
                    b_ary[tempb] = 1;
                } else {
                    if(tempn == 0) {
                        b_ary[tempb] = 1;
                        b_ary[tempb + 1] = 1;
                    } else {
                        if(tempd == 1) {
                            for(var j = 0; j < tempn; j++) {
                                b_ary[tempb + j * 7] = 1;
                            }
                        } else {
                            for(var j = 0; j < tempn; j++) {
                                b_ary[tempb + j] = 1;
                            }
                        }
                    }
                }
            }
            // console.log("b_ary =", b_ary);
        }
        function TimerCount() {
            Timer = setTimeout(TimerCount, 1000);
            if(isTimePause) return;

            if(nowSec > 0) {
                nowSec--;
            }
            SetClock();
            
            if(nowSec == 0) {
                clearTimeout(Timer);
                isAns = false;
                isQuit = false;
                isEnd = true;
                PlayOX(isAns, isQuit, isEnd);
            }
        }
        function SetClock() {
            var SecTxt = document.getElementById("SecTxt");
            SecTxt.innerHTML = nowSec;
        }
        function EndOfGame() {
            isStartGame = false;
            clearTimeout(Timer);
        }
        function Leave() {
            EndOfGame();
        }
        function SwitchBGMFunc(io) {
            var bgmOff = document.querySelector("#BGMBtn > .bgmOff");
            var bgmOn = document.querySelector("#BGMBtn > .bgmOn");

            if(isBGM) {
                bgmOff.setAttribute("display", "none");
                bgmOn.setAttribute("display", "block");
            } else {
                bgmOff.setAttribute("display", "block");
                bgmOn.setAttribute("display", "none");
            }
            window.parent.SwitchBGMFunc(isBGM, BGMvol);
        }
        function GetRandomAry(n) {
            var ary = [];
            while(n) {
                ary.splice(Math.random() * (ary.length + 1), 0, n--);
            }

            return ary;
        }
